import React from "react";

function Logo(props){
    return(
        <div className ="logo">
        <a style={{width: props}}href=""><img id="logo-img" src="https://cdn-icons-png.flaticon.com/512/992/992615.png" alt="logo" /></a>
        <a style={{fontSize: props.fsize}} style={{display: props.hide?"none":"unset"}} className="nav-item" href="">SeekCruiter</a>
    </div>
    )
}
export default Logo
